SELECT ?fatherOfChild WHERE {
  # Step 1: Identify the fathers
  ?fatherMuhith dbo:child dbr:Abul_Maal_Abdul_Muhith .
  ?fatherMomen dbo:child dbr:AK_Abdul_Momen .

  # Step 2: Find their children (if any)
  ?childMuhith dbo:parent ?fatherMuhith ;
              a dbo:Person .
  ?childMomen dbo:parent ?fatherMomen ;
              a dbo:Person .

  # Step 3: Identify the father of these children
  OPTIONAL { ?childMuhith dbo:parent ?fatherOfChild . }
  OPTIONAL { ?childMomen dbo:parent ?fatherOfChild . }

  FILTER (?fatherOfChild != ?fatherMuhith && ?fatherOfChild != ?fatherMomen)
}
