  # For Cliff Roquemore
  OPTIONAL { 
    ?cliffRoquemore dbo:deathPlace ?cliffDeathPlace .
    FILTER (isBlank(?cliffDeathPlace) || ?cliffDeathPlace a dbo:Settlement)
    ?cliffDeathPlace dbo:governor ?cliffDeathPlaceGovernor .
